window.bookSummaryJSON = "<p><b>Madness sits upon the throne.</b> <b>Rebellion rages in the South. Dark magic threatens all life. The kingdom is desperate for heroes.</b></p> <p>When the young king's soul is stolen by a traitorous cultist desperate to resurrect the Buried Goddess, disgraced knight Torsten Unger makes it his sworn duty to get it back. He has one chance to restore his honor. But he can't do it alone. He'll need a thief.&nbsp;</p> <p>Whitney Fierstown planned the perfect heist, one that would have made him a legend among thieves, until he got caught. Now, a knight with a questionable reputation is offering a deal: rot and die in a dank cell or join him on a dangerous expedition to put his skills to good use and earn his freedom.&nbsp;</p> <p>Whitney and Torsten must put aside their differences and work together to battle unholy cults, demons, rebels, and worse to become the heroes their war-torn kingdom never expected...if they don't kill each other first.&nbsp;</p> <p>Get Book 1 of the Buried Goddess Saga today! It's perfect for fans of epic fantasy adventures like King's Dark Tidings, The Riyria Chronicles, and <i>The Hobbit</i>.</p>"; 
